        <>
            <section className="container-fluid my-3">
                <h1 className="text-center display-4"> hello world</h1>
                <div className="row">
                    <div className="col-10 mx-auto">
                       
                        <div className="row">
                              
                        </div>

                    </div>
                </div>
            </section>
        </>
    );
}

export default AppService;
